import React from "react";
import userImage from '../../assents/userImage.png'
export default function NewCard() {
  return (
    <div className="card">
      <img src={userImage} className="Img" />
      <h1 style={{color:"#fff"}}>Jane Cooper</h1>
      <h3 className="customer_designation" style={{color}}>Art Director</h3>
    
    </div>
  );
}
